// 全角引用符 → 半角引用符
-(NSString*)stringByReplacingFullwidthQuotesWithHalfwidthQuotes
{
    NSMutableString *str = [NSMutableString stringWithString:self];
    
    [str replaceAllOccurrencesOfString:@"‘“" withString:@"`\\,``" addingPercentForEndOfLine:NO];
    [str replaceAllOccurrencesOfString:@"”’" withString:@"''\\,'" addingPercentForEndOfLine:NO];
    
    [str replaceAllOccurrencesOfString:@"“‘" withString:@"``\\,`" addingPercentForEndOfLine:NO];
    [str replaceAllOccurrencesOfString:@"’”" withString:@"'\\,''" addingPercentForEndOfLine:NO];
    
    [str replaceAllOccurrencesOfString:@"‘" withString:@"`" addingPercentForEndOfLine:NO];
    [str replaceAllOccurrencesOfString:@"’" withString:@"'" addingPercentForEndOfLine:NO];
    
    [str replaceAllOccurrencesOfString:@"“" withString:@"``" addingPercentForEndOfLine:NO];
    [str replaceAllOccurrencesOfString:@"”" withString:@"''" addingPercentForEndOfLine:NO];
    
    return str;
}

